                                  {data?.journey_date?.split("T")[0]}
                                </TableCell>
                                <TableCell> {data.total_price}</TableCell>
                                {tabValue == 1 && (
                                  <TableCell>
                                    {data.refund_status === 0 ? (
                                      <span
                                        style={{ color: "#C67931" }}
                                        className="f-w-500"
                                      >
                                        INITIATE
                                      </span>
                                    ) : data.refund_status === 1 ? (
                                      <span
                                        style={{ color: "#003556" }}
                                        className="f-w-500"
                                      >
                                        PROCESSED
                                      </span>
                                    ) : (
                                      <span
                                        style={{ color: "#1D9646" }}
                                        className="f-w-500"
                                      >
                                        COMPLETED
                                      </span>
                                    )}
                                  </TableCell>
                                )}

                                {tabValue == 4 && (
                                  <TableCell>
                                    {data.refund_status === 0 ? (
                                      <span
                                        style={{ color: "#C67931" }}
                                        className="f-w-500"
                                      >
                                        INITIATE
                                      </span>
                                    ) : data.refund_status === 1 ? (
                                      <span
                                        style={{ color: "#003556" }}
                                        className="f-w-500"
                                      >
                                        PROCESSED
                                      </span>
                                    ) : (
                                      <span
                                        style={{ color: "#1D9646" }}
                                        className="f-w-500"
                                      >
                                        CANCELLED
                                      </span>
                                    )}
                                  </TableCell>
                                )}

                                <TableCell>
                                  <IconButton
                                    onClick={() =>
                                      getBusBookingDetails(data.id)
                                    }
                                  >
                                    <RemoveRedEyeIcon />
                                  </IconButton>
                                </TableCell>
                              </TableRow>
                            ))}
                          </TableBody>
                        </Table>
                      </TableContainer>

                      {/* </Paper> */}
                    </Grid>
                  </Grid>
                  <Grid
                    container
                    justifyContent={"space-between"}
                    mt={2}
                    alignItems={"baseline"}
                  >
                    <Grid item>
                      {pageNumber * 10 - 10 + 1} - {pageNumber * 10 - 10 + 10}of{" "}
                      {totalRecordsCount}
                    </Grid>
                    <Grid item>
                      <ReactPaginate
                        breakLabel="..."
                        nextLabel="Next "
                        onPageChange={handlePageClick}
                        pageRangeDisplayed={5}
                        pageCount={totalPages}
                        previousLabel="Previous"
                        renderOnZeroPageCount={null}
                        containerClassName="mainPageCont"
                        activeClassName="activeClassName"
                        activeLinkClassName="activeLinkClassName"
                        pageClassName="pageClassName"
                        forcePage={pageNumber ==0?1:pageNumber-1}
                      />
                    </Grid>
                  </Grid>
                </Grid>
              </>
            )}
          </TabPanel>
        </TabContext>
      </Container>
    </>
  );
};

export default AdminBus;
